import * as React from 'react';
import { Text, View, StyleSheet, Animated, Dimensions } from 'react-native';
import { ScrollView, TouchableOpacity, FlatList } from 'react-native-gesture-handler';
import { Slide, CategorySlider, TutorialCard } from '../Components'

const categorias = [
  {icon: 'ios-fitness', title: 'Deporte', color: '#FF7070', key: '1'},
  {icon: 'ios-restaurant', title: 'Cocina', color: '#FFAD61', key: '2'},
  {icon: 'ios-musical-notes', title: 'Música', color: '#55CA4B', key: '3'},
  {icon: 'ios-camera', title: 'Fotografía', color: '#5297FF', key: '4'},
  {icon: 'ios-book', title: 'Literatura', color: '#926CFF', key: '5'},
  {icon: 'ios-brush', title: 'Arte', color: '#D55FFF', key: '6'},
  {icon: 'ios-flask', title: 'Ciencias', color: '#FF62D3', key: '7'},
  {icon: 'ios-code', title: 'Coding', color: '#807D7D', key: '8'},
  {icon: 'logo-game-controller-b', title: 'Gaming', color: '#0029B9', key: '9'},
]

const tutoriales = [
  {title: '6-Pack Abs Routine', image: require('../../assets/images/girl-sport.jpg')},
  {title: 'How to do Italian pasta', image: require('../../assets/images/pasta.jpg')},
  {title: 'Get aim on shooters', image: require('../../assets/images/shooter.jpg')},
  {title: 'How to do Italian pasta', image: require('../../assets/images/pasta.jpg')},
  {title: 'How to do Italian pasta', image: require('../../assets/images/pasta.jpg')},
  {title: 'How to do Italian pasta', image: require('../../assets/images/pasta.jpg')},
]

const screenHeight = Dimensions.get('window').height;
const slideHeight = screenHeight / 3


const Explore = ({ navigation }) => {
  var scrollY = new Animated.Value(0)
  const animtedValue = new Animated.Value(0)

  const animatedHeight = scrollY.interpolate({
    inputRange: [0, 50],
    outputRange: [slideHeight, 0],
    extrapolate: 'clamp'
  })

  const onScroll = () => {
    Animated.event([
      { nativeEvent: { contentOffset: {y: scrollY}}}
    ])
  }

  return (
    <View style={styles.content}>
      <Animated.View style={[styles.trendingTutorial, {height: animtedValue}]}>
        <ScrollView horizontal decelerationRate={0} snapToInterval={300} showsHorizontalScrollIndicator={false} bounces={true} style={{paddingLeft: 15, marginBottom: 10}}>
          <Slide title='6-Pack Abs Routine' image={require('../../assets/images/girl-sport.jpg')}/>
          <Slide title='How to do Italian pasta' image={require('../../assets/images/pasta.jpg')}/>
          <Slide title='Get aim on shooters' image={require('../../assets/images/shooter.jpg')}/>
        </ScrollView>
      </Animated.View>
      <View style={styles.categorySelector}>
        <ScrollView horizontal decelerationRate={0} snapToInterval={300} showsHorizontalScrollIndicator={false} bounces={false} style={{paddingLeft: 15, marginTop: 10, marginBottom: 10 }}>
          {categorias.map((item) => {
            return (
              <TouchableOpacity activeOpacity={0.8} onPress={() => navigation.navigate('ExploreCategory', { title: item.title, key: item.key })}>
                <CategorySlider icon={item.icon} color={item.color} />
              </TouchableOpacity>
            )
          })}
        </ScrollView>
      </View>
      <View style={styles.tutorialSelector}>
          <FlatList style={styles.lista} onScroll={onScroll}
            data={tutoriales}
            renderItem={({ item }) => (
              <TutorialCard title={item.title} image={item.image} />
            )}
          />
      </View>
    </View>
  );
};

export default Explore;

const styles = StyleSheet.create({
    content: {
      flex: 1,
      top: 15,
    },
    trendingTutorial: {

    },
    categorySelector: {
      borderTopColor: '#EAEAEA',
      borderTopWidth: 1,
      borderBottomColor: '#EAEAEA',
      borderBottomWidth: 1,
    },
    tutorialSelector: {
      padding: 10,
      flex: 1
    },
    lista: {
      marginBottom: 10
    }
});
